// Helper to compute dashboard summary
export function getDashboardSummary(data: QAMatrixEntry[]) {
  const total = data.length;
  const ngWorkstation = data.filter(d => d.workstationStatus === 'NG').length;
  const ngMfg = data.filter(d => d.mfgStatus === 'NG').length;
  const ngPlant = data.filter(d => d.plantStatus === 'NG').length;

  const byRating = (rating: 1 | 3 | 5) => {
    const items = data.filter(d => d.defectRating === rating);
    return {
      total: items.length,
      ngWorkstation: items.filter(d => d.workstationStatus === 'NG').length,
      ngMfg: items.filter(d => d.mfgStatus === 'NG').length,
      ngPlant: items.filter(d => d.plantStatus === 'NG').length,
      okWorkstation: items.filter(d => d.workstationStatus === 'OK').length,
      okMfg: items.filter(d => d.mfgStatus === 'OK').length,
      okPlant: items.filter(d => d.plantStatus === 'OK').length,
    };
  };

  return {
    total,
    ngWorkstation,
    ngMfg,
    ngPlant,
    rating1: byRating(1),
    rating3: byRating(3),
    rating5: byRating(5),
    recurrenceIssues: data.filter(d => d.weeklyRecurrence.some(w => w > 0)),
  };
}
